-- ----------------------------
-- Table structure for area
-- ----------------------------
DROP TABLE IF EXISTS `area`;
CREATE TABLE `area` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键，自动增加ID',
  `area_name` varchar(255) DEFAULT NULL COMMENT '区域名称',
  `sequence` int(11) NOT NULL COMMENT '排序',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '父类ID，0表示第一级',
  `level` int(11) unsigned DEFAULT NULL COMMENT '层级',
  `status` int(1) NOT NULL COMMENT '状态，1为可用，-1为不可用',
  `remark` varchar(128) DEFAULT NULL COMMENT '备注信息',
  `sending_price` decimal(5,2) DEFAULT '0.00' COMMENT '起送价',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='区域信息表';

