-- ----------------------------
-- Table structure for buyer
-- ----------------------------
DROP TABLE IF EXISTS `buyer`;
CREATE TABLE `buyer` (
  `buyer_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '来源于user表中的ID',
  `buyer_name` varchar(64) DEFAULT NULL COMMENT '买家名称(也就是餐馆名称)',
  `buyer_address` varchar(256) DEFAULT NULL COMMENT '餐馆地址',
  `lng` varchar(32) DEFAULT NULL COMMENT '经度',
  `lat` varchar(32) DEFAULT NULL COMMENT '纬度',
  `province_id` int(11) DEFAULT NULL COMMENT '所属省',
  `city_id` int(11) DEFAULT NULL COMMENT '所属市',
  `region_id` int(11) DEFAULT NULL COMMENT '所属区',
  `boss_name` varchar(32) DEFAULT NULL COMMENT '负责人',
  `boss_tel` varchar(16) DEFAULT NULL COMMENT '负责人的电话号码',
  `contact_name` varchar(32) DEFAULT NULL COMMENT '联系人',
  `contact_tel` varchar(16) DEFAULT NULL COMMENT '联系人电话号码',
  `balance_money` decimal(12,2) DEFAULT '0.00' COMMENT '账号余额',
  `buyer_type` int(4) DEFAULT NULL COMMENT '客户的类型，1为火锅店，2为小餐馆，3为中餐馆，4,为烧烤',
  `sale_id` bigint(20) DEFAULT NULL COMMENT '所属销售人员',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '所属卖家',
  `remark` varchar(256) DEFAULT NULL COMMENT '备注信息',
  `buyer_logo` varchar(126) DEFAULT NULL COMMENT '买家logo图片',
  `buyer_images` varchar(1024) DEFAULT NULL COMMENT '方便配送人员容易找到位置，所拍摄的多张图片',
  `open_time` varchar(20) DEFAULT NULL COMMENT '餐馆，早上开门时间',
  `end_time` varchar(20) DEFAULT NULL COMMENT '餐厅晚上关门时间',
  `delivery_time` varchar(20) DEFAULT NULL COMMENT '可以允许的物流最晚送达时间',
  `delivery_area_id` bigint(20) DEFAULT NULL,
  `buyer_menu` varchar(128) DEFAULT NULL COMMENT '买家菜单',
  `buyer_level` tinyint(4) DEFAULT NULL COMMENT '客户级别，1为A类客户,2为B类客户,3为C类客户',
  PRIMARY KEY (`buyer_id`),
  KEY `index_sale_id` (`sale_id`),
  KEY `index_region_id` (`region_id`),
  KEY `index_delivery_id` (`delivery_area_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='买家信息表.(俗称小B)';

-- ----------------------------
-- Records of buyer
-- ----------------------------

-- ----------------------------
-- Table structure for sales
-- ----------------------------
DROP TABLE IF EXISTS `sales`;
CREATE TABLE `sales` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动增加ID',
  `code` varchar(8) DEFAULT NULL COMMENT '销售人员唯一的Code编码，买家注册的时候需要填写',
  `phone` varchar(16) DEFAULT NULL COMMENT '手机号码',
  `password` varchar(32) DEFAULT NULL COMMENT 'md5加密',
  `true_name` varchar(16) DEFAULT NULL,
  `status` int(11) DEFAULT NULL COMMENT '1为在职，-1为离职',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `last_update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `level` int(11) DEFAULT NULL COMMENT '类型1总监 2主管 3职员',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '直属上级',
  PRIMARY KEY (`id`),
  KEY `unique_phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='销售人员基本信息';

-- ----------------------------
-- Records of sales
-- ----------------------------

-- ----------------------------
-- Table structure for seller
-- ----------------------------
DROP TABLE IF EXISTS `seller`;
CREATE TABLE `seller` (
  `seller_id` bigint(20) NOT NULL COMMENT '来源于users的ID',
  `seller_account` varchar(60) DEFAULT NULL COMMENT '账号,目前用手机号码作为账号',
  `seller_name` varchar(128) DEFAULT NULL COMMENT '店铺名称',
  `seller_alias` varchar(32) DEFAULT NULL COMMENT '店铺别名,可以理解为简称',
  `seller_logo` varchar(128) DEFAULT NULL COMMENT '店铺logo',
  `seller_licence` varchar(128) DEFAULT NULL COMMENT '营业执照',
  `seller_rank` tinyint(2) DEFAULT '0' COMMENT '店铺评级,默认为0',
  `seller_grade` double(4,1) DEFAULT '0.0' COMMENT '评分',
  `seller_address` varchar(255) DEFAULT NULL COMMENT '店铺地址',
  `seller_keyword` varchar(255) DEFAULT NULL COMMENT '关键字',
  `seller_tel` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `balance_money` decimal(12,2) DEFAULT '0.00' COMMENT '余额',
  `bill_money` decimal(12,2) DEFAULT '0.00' COMMENT '账单金额,用于提现的计算',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `seller_type` tinyint(4) DEFAULT NULL COMMENT '类型 1自营 2加盟 3合作',
  `regions` varchar(255) DEFAULT NULL COMMENT '所属区域,多个区域用逗号进行相隔',
  PRIMARY KEY (`seller_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='卖家信息表.(俗称经销商)';

-- ----------------------------
-- Records of seller
-- ----------------------------

-- ----------------------------
-- Table structure for sms
-- ----------------------------
DROP TABLE IF EXISTS `sms`;
CREATE TABLE `sms` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动增加ID',
  `phone` varchar(11) DEFAULT NULL COMMENT '手机号',
  `message` varchar(256) DEFAULT NULL COMMENT '内容',
  `remark` varchar(32) DEFAULT NULL COMMENT '备注短信的作用或者说明',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3531 DEFAULT CHARSET=utf8 COMMENT='手机短信验证码';

