-- Records of sms
-- ----------------------------

-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动增加ID',
  `account` varchar(64) NOT NULL COMMENT '账号，目前采用手机号码为账号',
  `password` varchar(64) NOT NULL COMMENT '密码',
  `true_name` varchar(32) DEFAULT NULL COMMENT '真实姓名',
  `status` int(11) DEFAULT NULL COMMENT '状态，  -1 表示，强制下架,坚决不可用,0 刚注册，未完成资料。1.完成了资料，未审核。2.完成了资料，审核未通过。3.审核通过，可以用. 4为暂停关店',
  `create_time` datetime DEFAULT NULL COMMENT '注册时间',
  `type` int(11) DEFAULT NULL COMMENT '1为买家，2为卖家',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后一次登录时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_account` (`account`)
) ENGINE=InnoDB AUTO_INCREMENT=2094 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of users
-- ----------------------------
